CREATE TABLE tst01.Product
(
    id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    our_name varchar(1024),
    min_lefttime varchar(50),
    citilinkURL varchar(500),
    synonyms text,
    title varchar(500),
    citilinkPrice float,
    picture_url varchar(1024),
    last_all_ebay_count int(11),
    last_approve_ebay_count int(11),
    min_procent int(11) DEFAULT '50',
    max_procent int(11) DEFAULT '80',
    ebay_ids text,
    citilinkID int(11),
    ebay_price varchar(10),
    citilink_data longtext,
    categoryID int(11)
);
